import React from 'react'

function ArticleList({ articles }) {
    return (
        articles.map(article => {
            return (
                <div key={article.id}>
                    <h2>{article.title}</h2>
                    <p>{article.body}</p>
                    <p>{article.date}</p>
                </div>
            )
        })
    )
}

export default ArticleList
